def state2tensor(state):
  if isinstance(state, dict):
    turn = state['turn']
    timer = state['timer']
    kitchen = state['kitchen']
    items = state['items']
    orders = state['orders']
    
  else:
    turn, timer, kitchen, items, orders = state
  # Kitchen and Items (= board) state
  max_x = len(kitchen[0])
  max_y = len(kitchen) 
  
  board_state = np.zeros([max_y, max_x, board_vocab.size], dtype=np.int32)
  for y, kitchen_line in enumerate(kitchen):
    for x, tile in enumerate(kitchen_line):
      tile_id = board_vocab.token2id(tile)
      board_state[y][x][tile_id] += 1

  for x, y, item_list in items:
    for item in item_list:
      item_id = board_vocab.token2id(item)
      board_state[y][x][item_id] += 1

  order_state = np.zeros([3, item_vocab.size], dtype=np.int32)
  awards = []
  for i, (items, award) in enumerate(orders):
    awards.append(award)
    for item in items:
      item_id = item_vocab.token2id(item)
      order_state[i][item_id] += 1

  timer_state = np.zeros([11])
  timer_state[timer] = 1

  state = {
    'turn': turn,
    'board': board_state,
    'orders': order_state,
    'order_awards': awards,
    'timer': timer
  }
  return state


