#######################################
##          Game Classes
#######################################

class Tile:
  def __init__(self, x, y, name):
    self.x = x
    self.y = y
    self.name = name

class Kitchen:
  def __init__(self, tiles):
    self.tiles = tiles
    self.oven = [x for x in flatten(tiles) if x.name == OVEN][0]

  @property
  def state(self):
    return [[t.name if t.name not in [PLAYER, PARTNER] else '.' for t in kitchen_line] for kitchen_line in self.tiles]

  def __repr__(self):
    return "\n".join(''.join(self.state))

class Player:
  def __init__(self, x, y, item):
    self.x = int(x)
    self.y = int(y)
    self.item = item

class Order:
  def __init__(self, item, award):
    self.item = item
    self.award = int(award)

  def __repr__(self):
    return str((parse_item(self.item), self.award))

class Game:
  def __init__(self, kitchen, order_schedules):
    # Fixed states.
    self.kitchen = kitchen
    self.order_schedules = order_schedules

    # Updatable states.
    self.turn = 0 # Current turn.
    self.player = None
    self.partner = None
    self.orders = None
    self.items = None

    self.awards = []
    self.orders_in_previous_turn = None

  def update_reward(self, orders):
    if not self.orders_in_previous_turn:
      self.awards.append(0)
    else:
      cur_orders = [(parse_item(o.item), o.award - 2) for o in orders]
      prev_orders = [(parse_item(o.item), o.award - 2) for o in self.orders_in_previous_turn]

    self.orders_in_previous_turn = orders

  def update(self, turns_remaining, player, partner, tables, oven, orders):
    self.player = player
    self.partner = partner
    self.orders = orders

    self.items = []
    self.items += tables
    oven_item, oven_timer = oven
    if oven_item and oven_item != NONE:
      self.items += [(self.kitchen.oven.x, self.kitchen.oven.y, oven_item)]
    self.oven_timer = oven_timer
    self.update_reward(orders)
    self.turn += 1

  def log_state(self, action, as_json=True):
    
    if as_json:
      #state = self.state_tensor
      turn, timer, kitchen, items, orders = self.state
      state = {}
      state['turn'] = turn
      state['kitchen'] = kitchen
      state['items'] = items
      state['orders'] = orders
      state['timer'] = timer
      # for k, v in state.items():
      #   if type(v) == np.ndarray:
      #     state[k] = v.tolist()
      log(json.dumps(state))
    else:
      turn, timer, kitchen, items, orders = self.state
      kitchen = '\n'.join([''.join(line) for line in kitchen])
      log('Turn: ', turn)
      log('Oven Timer:', timer)
      log('Kitchen:')
      log(kitchen)
      log('Items: ', items)
      log('Orders: ', orders)
      log('Action: ', action)

  @property
  def state(self):
    kitchen_state = self.kitchen.state
    kitchen_state[self.player.y][self.player.x] = PLAYER
    kitchen_state[self.partner.y][self.partner.x] = PARTNER
    items_state = [(x, y, parse_item(item_str)) for x, y, item_str in self.items]
    orders_state = [(parse_item(order.item), order.award) for order in self.orders]
    state = [self.turn, self.oven_timer, kitchen_state, items_state, orders_state]
    return state

