class NPCNNBased:
  def __init__(self, config):
    self.config = config
    self.params = self.read_params(config) if config.model_root_path else PARAMS

  def read_params(self, config):
    _parameters_dir = config.model_root_path + '/parameters'
    if hasattr(config, 'epoch') and config.epoch:
      parameters_dir = _parameters_dir + '/%03d' % config.epoch
    else:
      parameters_dir = _parameters_dir + '/' + os.listdir(_parameters_dir)[-1]
    params = recDotDefaultDict()
    for f in os.listdir(parameters_dir):
      params[f] = np.loadtxt(open(parameters_dir + '/' + f))
    print(params.keys())
    return params

  def cnn_2d(self, inputs, filter_w, filter_b, strides=[0, 1, 1, 0], 
             padding='SAME', scope=None, dtype=np.float16,
             activation=np.tanh):

    # inputs: [height, width, in_channels]
    if padding == 'SAME':
      inputs = np.pad(inputs, [(1,1), (1,1), (0,0)], 'constant')
    elif padding == 'VALID':
      pass
    _, x_stride, y_stride, _ = strides
    ih, iw, in_channels = inputs.shape
    fh, fw, in_channels, out_channels = filter_w.shape

    out_h = (ih - fh + 1) // y_stride
    out_w = (iw - fw + 1) // x_stride
    outputs = np.zeros([out_h, out_w, out_channels], dtype=np.float16)
    for i in range(out_h):
      for j in range(out_w):
        chunk = inputs[i*y_stride:i*y_stride+fh, 
                       j*x_stride:j*x_stride+fw, :]
        outputs[i][j] = np.matmul(
          np.reshape(chunk, [-1]),
          np.reshape(filter_w, [-1, out_channels]))  + filter_b
    outputs = activation(outputs)
    return outputs

  # def max_pool(self, inputs, filter_w, strides=[1, 1, 1, 1], padding='SAME'):
  #   fh, fw, _ = filter_w.shapea
  #   ksize = [1, fh, fw, 1]
  #   raise NotImplementedError
  #   return inputs

  def getAction(self, game):
    if hasattr(self.config, 'epsilon') and np.random.rand() < self.config.epsilon:
      action_id = np.random.randint(action_vocab.size)
    else:
      values = self.inference(state2tensor(game.state))
      action_id = np.argmax(values)
    action = action_vocab.id2token(action_id)
    return action

  def inference(self, inp):
    return self.infer_rewards(inp['board'])

  def infer_rewards(self, board_inp):
    board_inp = board_inp.astype(np.float16)
    embeddings_board = self.params.embeddings_board
    embeddings_action = self.params.embeddings_action
    filter_w = np.reshape(self.params.L1_CNN_w, [self.config.filter_h, self.config.filter_h, self.config.emb_size, -1])
    filter_b = self.params.L1_CNN_b
    
    wait_emb = embeddings_action[0]
    move_emb = embeddings_action[1]
    use_emb  = embeddings_action[2]

    assert len(board_inp.shape) == 3
    y, x, v = board_inp.shape
    emb_size = embeddings_board.shape[-1]
    emb_inp = np.reshape(np.matmul(np.reshape(board_inp, [y*x, v]), 
                                   embeddings_board), 
                         [y, x, emb_size])

    cell_repls = self.cnn_2d(emb_inp, filter_w, filter_b)
    hidden_state = np.average(cell_repls, axis=(0,1))

    def _expand(state):
      state = np.expand_dims(state, axis=0)
      state = np.expand_dims(state, axis=0)
      return state
    state_for_move = _expand(hidden_state * move_emb)
    state_for_use = _expand(hidden_state * use_emb)
    wait_reward = np.expand_dims(np.sum(hidden_state * wait_emb, axis=-1), 1)
    move_rewards = np.sum(state_for_move * cell_repls, axis=-1)
    move_rewards = np.reshape(move_rewards, [x*y])
    use_rewards = np.sum(state_for_use * cell_repls, axis=-1)
    use_rewards = np.reshape(use_rewards, [x*y])
    rewards = np.concatenate([wait_reward, move_rewards, use_rewards], axis=-1) #[batch_size, 1 + 2 * x * y] 
    return rewards


def play(logic):
  # ALL CUSTOMERS INPUT: to ignore until bronze
  num_all_customers = int(input())

  order_schedules = []
  for i in range(num_all_customers):
    customer_item, customer_award = input().split()
    customer_award = int(customer_award)
    order_schedules.append(Order(customer_item, customer_award))

  # KITCHEN INPUT
  tiles = []
  for y in range(7):
    kitchen_line = [Tile(x, y, tileChar) for x, tileChar in enumerate(input())]
    tiles.append(kitchen_line)
  kitchen = Kitchen(tiles)
  game = Game(kitchen, order_schedules)

  # game loop
  while True:
    turns_remaining = int(input())

    # PLAYERS INPUT
    player = Player(*input().split())
    partner = Player(*(input().split()))

    # Gather and update table information
    num_tables_with_items = int(input())  # the number of tables in the kitchen that currently hold an item

    tables = []
    for i in range(num_tables_with_items):
      table_x, table_y, item = input().split()
      table_x = int(table_x)
      table_y = int(table_y)
      tables.append((table_x, table_y, item))

    oven_contents, oven_timer = input().split()
    oven_timer = int(oven_timer)
    oven = (oven_contents, oven_timer)

    num_customers = int(input())  # the number of customers currently waiting for food
    orders = [Order(*(input().split())) for i in range(num_customers)]

    game.update(turns_remaining, player, partner, tables, oven, orders)
    
    # GAME LOGIC
    action = logic.getAction(game)
    game.log_state(action)
    print(action)


def get_parser():
  desc = ""
  parser = argparse.ArgumentParser(description=desc)
  # parser.add_argument('mode', type=str, help ='')
  parser.add_argument('-mrp', '--model_root_path', default=None, type=str)
  parser.add_argument('-e', '--epoch', default=None, type=int)
  parser.add_argument('--filter_h', default=3, type=int)
  parser.add_argument('--filter_w', default=3, type=int)
  parser.add_argument('--emb_size', default=20, type=int)
  parser.add_argument('--out_channels', default=20, type=int)
  parser.add_argument('-eps', '--epsilon', default=0.0, type=float)
  
  # parser.add_argument('-ct','--config_type', default='tmp', type=str, help ='')
  return parser


def main(args):
  logic = NPCNNBased(args)
  play(logic)

if __name__ == "__main__":
  import argparse
  parser = get_parser()
  args = parser.parse_args()
  main(args)





